    protected override Humidifier.CodeDeploy.DeploymentGroupTypes.BlueGreenDeploymentConfiguration Create()
    {
        var blueGreenDeploymentConfigurationResult = CreateBlueGreenDeploymentConfiguration();
        factoryAction?.Invoke(blueGreenDeploymentConfigurationResult);

        return blueGreenDeploymentConfigurationResult;
    }

    private Humidifier.CodeDeploy.DeploymentGroupTypes.BlueGreenDeploymentConfiguration CreateBlueGreenDeploymentConfiguration()
    {
