        result.GreenFleetProvisioningOption ??= GreenFleetProvisioningOptionFactory?.Build();
        result.TerminateBlueInstancesOnDeploymentSuccess ??= TerminateBlueInstancesOnDeploymentSuccessFactory?.Build();
    }

